class SquareHabitatConnector(HtmlConnector):

    def __init__(self):
        super().__init__()
        self.state_args={}
        self.cookies=None


    def init_state(self):
        req = requests.get("https://www.squarehabitat.fr", headers={
            "Host" : "www.squarehabitat.fr",
            "User-Agent" : "Mozilla/5.0 (X11; Linux x86_64; rv:98.0) Gecko/20100101 Firefox/98.0",
            "Accept" : "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,*/*;q=0.8",
            "Accept-Language" : "fr,en;q=0.7,en-US;q=0.3",
            "Accept-Encoding" : "gzip, deflate, br",
            "DNT" : "1",
            "Connection" : "keep-alive",
            "Upgrade-Insecure-Requests" : "1",
        })
        d = pq(req.content)
        for field in ["__EVENTTARGET", "__EVENTARGUMENT", "__VIEWSTATE", "__VIEWSTATEGENERATOR",
                      "__SCROLLPOSITIONX", "__SCROLLPOSITIONY", "__EVENTVALIDATION"]:
            x = d(f"#{field}").attr("value")
            self.state_args[field]= "" if x is None else x
            self.cookies=req.cookies


    def from_request(self, req):
        if isinstance(req, Post):
            self.init_state()
        return req().pq


